script: |
  super -f text -I q13253.spq | sort > q13253.out

inputs:
  - name: q13253.spq
    data: |
      SELECT DISTINCT - col0 + CAST ( + col1 AS REAL ) FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 NOT IN ( - col2, + col1, ( - + col2 ) * col1 - - 90 );
  - name: tab2

outputs:
  - name: q13253.out
    data: |
